import React, { useEffect } from 'react';
import './App.css';
import Weather from './Weather';

const changeBackground = (temp) => {
  useEffect(() => {
    console.log(temp);
  });
};

function App() {
  return (
    <div>
      <h1>Hello Tanveer</h1>
      <hr />
      <div>
        <Weather value={changeBackground} />
      </div>
    </div>
  );
}

export default App;
